content.description:
This originally trad route follows a right-angling crack system up about 30 feet, then it goes straight up a v-slot to the top.  Retrobolting allows a variation (

Cat's Meow

) straight up the bottom and out onto the face at the top.  There is an intermediate crux getting over the triangular bulge at bolt 4, and clipping the last bolt can be a bit balancy.

content.protection:
8 bolts on variation.  The top anchors are shared with the adjacent route (

Twinkletoes

).
